def aupto(limit):
  c = [i**3 for i in range(1, int(limit**(2/3))+2) if i**3 <= limit**2]
  cc = [c1 + c2 for i, c1 in enumerate(c) for c2 in c[i+1:]]
  return sorted([i for i in range(1, limit+1) if i*i in cc])
